import React from "react";
import "./Paymentcard.css";
const Paymentcard = () => {
  return (
    <>
      <div className="pay_card" style={{position:"sticky", top:"10px"}}>
        <div className="payment_card"></div>
      </div>
    </>
  );
};

export default Paymentcard;
